BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "mpg" (
	"biz_id"	INTEGER NOT NULL,
	"biz_name"	TEXT,
	"biz_addr"	TEXT,
	"biz_city"	TEXT,
	"biz_state"	TEXT,
	"biz_zip"	TEXT,
	"biz_county"	TEXT,
	"biz_minority"	TEXT,
	"biz_contact_name"	TEXT,
	"biz_phone"	TEXT,
	"biz_email"	TEXT,
	"biz_cert"	TEXT,
	"biz_cert_date"	TEXT,
	"biz_web"	INTEGER,
	"biz_naics"	TEXT,
	"biz_service"	INTEGER,
	PRIMARY KEY("biz_id" AUTOINCREMENT)
);
COMMIT;
